import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';
import axios from 'axios';

function App() {
    const [data, setData] = useState();
    return <button onClick={() => axios.get('api/company').then((r) => console.log(r))}>Fetch</button>;
    useEffect(() => {
        axios.get('api/company').then((r) => console.log(r));
    });
    return <div className="App">Hello there</div>;
}

export default App;
